// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;
import "hardhat/console.sol";

contract BaggageTracker {

    enum CustomerStatus{BOARDED, CHECKIN}
    enum BaggageStatus{CHECK_IN, SECURITY, BOARDED, DELAYED}

    struct Customer {
        string id;
        CustomerStatus status;
    }

    struct Baggage{
        string id;
        uint last_scanned_timestamp;
        BaggageStatus status;
    }

    address public baggageOfficial;

    constructor(){
        baggageOfficial = msg.sender;
    }

}

